import React from 'react';
import './Calendar.css';

const Calendar = () => {
  return (
    <div className="calendar-page">
      <div className="page-header">
        <h1>Calendar</h1>
      </div>
      <div className="calendar-content">
        <p>Calendar interface coming soon...</p>
      </div>
    </div>
  );
};

export default Calendar;
